import { Container,Form } from 'react-bootstrap'

export default function Login() {
  return (
    <Container>
        <Form>
            <Form.Group>
                <Form.Label>Enter Your Id</Form.Label>
            </Form.Group>
        </Form>
    </Container>
  )
}
